import React from "react";
import { Route, Switch} from "react-router-dom";

import SignIn from '../pages/SignIn.js'

const MainRoute = () => {
    return (
        <Switch>
            <Route exact path="/signin" component={SignIn} />>
        </Switch>
    );
};

export default MainRoute;
